import React from "react";
import { Navbar, Nav, NavbarBrand, NavItem, NavLink } from "reactstrap";
import tagsData from "../data/tagsData";

export default function DisplayBar({ activeOption }) {
  return (
    <Navbar color="light" light expand="md">
      <NavbarBrand href="">
        {activeOption.emoji ? activeOption.emoji : tagsData.find(tagData => tagData.id === activeOption.id) === undefined
                    ? ""
                    : tagsData.find(tagData => tagData.id === activeOption.id).emoji} {activeOption.name}
      </NavbarBrand>
      <Nav className="ml-auto" navbar>
        <NavItem>
          <NavLink href={activeOption.url}>	&#123; &#125;</NavLink>
        </NavItem>
      </Nav>
    </Navbar>
  );
}
